export class FoodProduct {
    action;
    numPro;
    nom;
    poids;
    etat;
    prix;
    typePro = "";
    typeCargo = "";
    clientApport;
    destinataire;
    constructor(action, numPro, nom, poids, etat, prix, clientsApport, destinataire) {
        this.action = action;
        this.numPro = numPro;
        this.nom = nom;
        this.poids = poids;
        this.etat = etat;
        this.prix = prix;
        this.clientApport = clientsApport;
        this.destinataire = destinataire;
    }
}
